import { useCallback } from 'react';
import ReactFlow, {
    MiniMap,
    Controls,
    Background,
    useNodesState,
    useEdgesState,
    addEdge,
} from 'reactflow';
// ðŸ‘‡ you need to import the reactflow styles
import 'reactflow/dist/style.css';
import './Editor.css';
import UsualNode from '../nodes/UsualNode/UsualNode';
import manyFromJson from '../nodes/fromJson';

const nodeTypes = { usual: UsualNode };

const debug_input = "[{\"name\":\"multiplyff\",\"code\":\"float multiplyff(float a, float b){\\n\\treturn a * b;\\n}\",\"id\":6,\"additionElements\":[],\"parameters\":[],\"positionX\":10,\"positionY\":0,\"width\":200,\"height\":130, \"inputs\": [{\"type\":\"float\",\"name\":\"a\",\"id\":0, \"connectedSource\": \"node24output0\"}, {\"type\":\"float\",\"name\":\"b\",\"id\":1, \"connectedSource\": \"node7output0\"}], \"parameters\": [], \"output\": {\"type\":\"float\",\"name\":\"result\",\"id\":0}}]";
const initialNodes = concat([...manyFromJson(debug_input)],
    { id: 'node-3', type: 'usual', position: { x: 0, y: 0 }, data: { type: "bool", inputs: [{ name: "c", type: "float" }, { name: "f", type: "bool" }, { name: "e", type: "float" }], title: "Node 1" } },
);

const initialEdges = [];

export default function Editor() {
    const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
    const [edges, setEdges, onEdgesChange] = useEdgesState(initialEdges);

    const onConnect = useCallback((params) => setEdges((eds) => addEdge(params, eds)), [setEdges]);

    const compile = () => {
        console.log("compile");
    }

    return (
        <>
            <button onClick={compile}>
                Compile
            </button>
            <div className="editor">
                <ReactFlow
                    nodes={nodes}
                    edges={edges}
                    onNodesChange={onNodesChange}
                    onEdgesChange={onEdgesChange}
                    onConnect={onConnect}
                    nodeTypes={nodeTypes}
                >
                    <MiniMap />
                    <Controls />
                    <Background />
                </ReactFlow>
            </div>
        </>
    );
}
